public class FindPrimeNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num = 10;
				
		if(num%2==1) {
			System.out.println("This is prime number"+num);
			
			
		}
		System.out.println("This is not a prime number");
	}

}
